### Summary

This pull request addresses an issue with the `fetch` adapter's handling of the `withCredentials` option in Axios. The current implementation incorrectly sets `withCredentials` instead of `credentials` in the `Request` object, leading to unexpected behavior.

### Issue

When using the `fetch` adapter with `withCredentials: true`, the cookies are not included in the requests as expected. This inconsistency between Axios and the native `fetch` API causes issues when making cross-origin requests that require credentials.

### Demos
#### Server Code
```js
const express = require('express');
const cors = require('cors');
const cookieParser = require('cookie-parser');

const app = express();
const port = 3000;

app.use(cors({
  origin: 'http://localhost:5000', // Replace with the allowed frontend address
  credentials: true, // Allow credentials
}));

// Use Cookie Parser Middleware
app.use(cookieParser());

// Example route to read Cookies
app.get('/', (req, res) => {
  const cookies = req.cookies;
  console.log('Cookies:', cookies);

  res.json({
    message: 'Cookies received',
    cookies: cookies,
  });
});

// Start server
app.listen(port, () => {
  console.log(`Server is running on http://localhost:${port}`);
});
```
#### Client Code Using Native fetch API
```js
fetch('http://localhost:3000', {
  method: 'GET',
  credentials: 'include'
})
  .then(response => response.json())
  .then(data => console.log(data))
  .catch(error => console.error('Error:', error));

```
The above code correctly prints out all the cookies. If credentials is set to `omit` or `same-origin`, the cookies will be an empty object.

#### Client Code Using Axios fetch adapter
```js
axios.get('http://localhost:3000', {
  withCredentials: true,
  adapter: ['fetch']
})
  .then(response => console.log(response.data))
  .catch(error => console.error('Error:', error));

```
In the above code, if withCredentials is set to include, the printed cookies are an empty object, which is not the expected behavior. By reviewing the source code, it was found that the fetch adapter incorrectly handles the `withCredentials` option. The `Request` constructor in the fetch API should receive a `credentials` option instead of `withCredentials`, with valid values being `omi`t, `same-origin`, and i`nclude`,but not include `cors`

### Solution

Replace the usage of `withCredentials` with `credentials` in the `Request` object initialization within the `fetch` adapter.

### Changes

- Modify `lib/adapters/fetch.js`:
  ```js
  if (!utils.isString(withCredentials)) {
    withCredentials = withCredentials ? 'include' : 'omit';
  }

  request = new Request(url, {
    ...fetchOptions,
    signal: composedSignal,
    method: method.toUpperCase(),
    headers: headers.normalize().toJSON(),
    body: data,
    duplex: "half",
    credentials: withCredentials
  });

### Verification
The corrected fetch adapter now works as expected, aligning with the behavior of the native fetch API. Here are the verification steps:

- Run the server code provided in the description.
- Execute the client code using both the native fetch API and Axios with the modified fetch adapter.
- Confirm that the cookies are correctly included in the response when `withCredentials: true` is set.

Fixes #6417

On line 14 of `lib/helpers/throttle.js`, `throttle` expects `this` to be `true` when a call to `fn` is enforced; however, `this` would never equal to `true` / `false` in non-strict mode as `this` cannot be a primitive. It instead is a wrapper object around the value in non-strict mode when it is called by `Function.prototype.call()` with `this` bound to any primitive value.

This PR partially reverts d01386e60ace84e4ac19e121c22ebf00ba66f0eb by making `force` a parameter so it works both in strict and non-strict mode.

```javascript
f = function () {
  console.log(this === true);
  console.log(this instanceof Boolean);
  console.log(this.valueOf() === true);
};

f.call(true) // => false true true
```

```javascript
g = function () {
  'use strict';
  console.log(this === true);
  console.log(this instanceof Boolean);
  console.log(this.valueOf() === true);
};

g.call(true) // => true false true
```

The goal of this PR is to add a minimal fetch implementation that provides the same capabilities as the xhr adapter without major changes, allowing it to be released in Axios 1.x.
To avoid breaking changes, by default fetch adapter will be used if the xhr and http adapters are not available. The user can explicitly select it in the config if needed.

```js
const url = 'https://httpbin.org/post';

const form = new FormData();
form.append('foo', '123');

const {data} = await axios.post(url, form, {
   adapter: 'fetch',
   params: {
      foo: 1,
      bar: 2
   },
   onUploadProgress(e) {
      console.log('Upload:', e);
   },
   onDownloadProgress(e) {
      console.log('Download:', e);
   }
});
```

Fixes #6090 

Used solutions from #6028 and #6046 to resolve the [CVE-2023-45857 vulnerability](https://www.mend.io/vulnerability-database/CVE-2023-45857) in Axios `0.x` 

Breaking change:
`axios('http://example.com/')` will no longer set an XSRF token by default. To maintain old behavior, a truthy value for `withXSRFToken` must be passed. i.e.  `axios('http://example.com/')` would need to be changed to something akin to:

```
axios('http://example.com/', {
   withXSRFToken: true
});
```

This PR adds the ability to specify `origins` option to allow configuration changes based on the origin of the target URL
I don‚Äôt really believe in the advisability of introducing this functionality, but since the community wants to be able to control the installation of an XSRF token based on the origin, then we should make this functionality more general, and not just to control one feature.
Origins configuration merges with request config **after request interceptors**, but before transformRequest is called, since the target address can be changed inside the interceptor.

```js
const instance = axios.create({
  origins: {
    'mysite.com': { // not including subdomains
      withCredentials: true,
      withXSRFToken: true
    },
    'profile|shop.mysite.com': {},
    '*.mysite.com': {},
    '**.mysite.com': {
      withXSRFToken: true
    }, // for all subdomains
    'https://**': { // for all https requests
      withCredentials: true
    }
  }  
})
```

Identifying the Issue:

The issue arises when using Axios versions 1.2.1 or greater and involves a missing constant within the Axios library. Specifically, the error is triggered within the Axios HTTP adapter, particularly in the zlibOptions object. This missing constant is causing errors when trying to access exports12.constants.Z_SYNC_FLUSH.

Understanding the Error:

The error message that you might encounter when using Axios versions 1.2.1 or greater might look like this:

Uncaught TypeError: Cannot read properties of undefined (reading 'Z_SYNC_FLUSH') This error message indicates that the code is attempting to access the property Z_SYNC_FLUSH within the constants object, which is missing or undefined in the Axios version you are using.

Temporary Workaround:

To address this issue until an official fix is provided, you can make a temporary modification to the http.js file. Here's how to do it:

Locate the http.js file within the Axios library. It is typically located in the node_modules/axios/lib/adapters directory.

Inside http.js, find the section that defines the zlibOptions object, which looks like this:

var zlibOptions = {
flush: exports12.constants.Z_SYNC_FLUSH,
finishFlush: exports12.constants.Z_SYNC_FLUSH
};
Modify it to add a fallback value when exports12.constants.Z_SYNC_FLUSH is undefined:

var zlibOptions = {
flush: exports12.constants.Z_SYNC_FLUSH || 2, // Use any suitable value as a fallback finishFlush: exports12.constants.Z_SYNC_FLUSH || 2 // Same fallback value };

### Proposed changes
Handle timeout logic to destroy the request to avoid the below problem.

### Description of the problem
I sometimes encountered a repeating ECONNRESET error after ETIMEDOUT error. I reproduced it like the below code.
e.g.
```
for (let i = 0; i <= 10; i++) {
  try {
    res = await axios.request(config);
    break;
  } catch(e) {
    console.log(e.code);
  }
}
```

It probably has a problem with handling timeouts. According to [the node docs about timeout event](https://nodejs.org/api/http.html#event-timeout), The request must be destroyed manually when timeout. 
Maybe related to some ECONNRESET issues https://github.com/axios/axios/issues?q=is%3Aissue+is%3Aopen+ECONNRESET+

