This pull request integrates [`http.maxHeaderSize`](https://nodejs.org/docs/latest-v16.x/api/http.html#httpmaxheadersize) support to axios http adapter, allowing users to overwrite nodejs `--max-http-header-size` programatically, from within axios config.

Code example:
```js
(async () => {
    const data = await axios({
        method: 'get',
        maxHeaderSize: <BYTES>
    })
})()
```

-  add hotfix to use the asynchronous API to compute the `content-length` header value; Closes #5520 

Now you do not need to specify the size of the stream, so you can transfer the stream directly.

If the request size cannot be calculated, the `content-length` header will be silently omitted, which is acceptable for most servers.

```js
await axios.post('https://httpbin.org/post', {
  file: fs.createReadStream("./data.txt")
}, {
  headers: {
    'Content-Type': 'multipart/form-data'
  }
});
```

```js
await axios.postForm('https://httpbin.org/post', {
  file: fs.createReadStream("./data.txt")
});
```

