A workaround has been applied until the next major release.
We still need to separate the user/raw/external config interface from the internal one, but instead of renaming the raw config interface, we've renamed the internal one as it may have less impact on the ecosystem at the moment. **`RawAxiosRequestConfig` is still available as an alias of `AxiosRequestConfig`** to minimize the inconvenience to users who have already migrated to the new interface name.

- renamed `AxiosRequestConfig` to `InternalAxiosRequestConfig`;
- renamed `RawAxiosRequestConfig` back to `AxiosRequestConfig`;
- added `RawAxiosRequestConfig` as an alias of `AxiosRequestConfig`;

```ts
axios.interceptors.request.use(async (config: InternalAxiosRequestConfig) => {

});

const config: AxiosRequestConfig = {};

axios(config);
```

- Added missed iterator declaration for AxiosHeaders interface;
  Now iteration over AxiosHeaders is valid for TS as well; Closes #5476;
```ts
const headers = new AxiosHeaders({foo: "bar"})

for (const [header, value] of headers) {
  console.log(header, value);
}
```
- Improved `AxiosRequestHeaders` type to be able to handle assignment of an AxiosHeaders instance;
```ts
  const headers:AxiosRequestHeaders = new AxiosHeaders({x:1});

  headers.y = 2;

  headers.get('x');
```

```ts
  const requestInterceptorId: number = axios.interceptors.request.use(
      async (config) => {
        config.headers.Accept ="foo1";
        config.headers.setAccept("foo2");
        config.headers = new AxiosHeaders({x:1});
        config.headers.foo = "1";
        config.headers.set('bar', '2');
        // config.headers = {...config.headers, myHeader: "myValue"}; // throws type error in TS, but works in JS runtime, possible workaround:
         config.headers.set({myHeader: "myValue"})
        // config.headers = {myHeader: "myValue"}; // throws type error in TS, but works in JS runtime, possible workaround:
         config.headers = new AxiosHeaders({myHeader: "myValue"});
         // OR
         config.headers = {...config.headers} as AxiosRequestHeaders;
        // since Axios will automatically convert plain object headers to an AxiosHeaders instance after interceptors and transforms calls
        return config;
      },
      (error: any) => Promise.reject(error)
  );
```

- Refactored `AxiosRequestConfig` to `RawAxiosRequestConfig` interface;
- Re-added `AxiosRequestConfig` as a subinterface of `RawAxiosRequestConfig`;
```ts
export interface AxiosRequestConfig<D = any> extends RawAxiosRequestConfig {
  headers: AxiosRequestHeaders;
}
```

```ts
axios.interceptors.request.use((req: AxiosRequestConfig) => {
  req.headers.set('foo', 'bar');
  req.headers['Content-Type'] = 123;
  return req;
});
```

