```js
axios.get(url, {
  adapter: 'http' // 'xhr'
});
```

We can use auto-select from the list (If the adapter is not supported its handle is set to false and Axios tries to set the next one):

```js
axios.get(url, {
  adapter:  ['xhr', 'http', function myCustomAdapter(config){}]
});
